  }

  &__person-info {
    position: relative;
    z-index: 3;
  }

  &__person-name {
    font-weight: bold;
    font-size: 1.125rem;
    line-height: 140%;
    color: $white;
  }

  &__person-type {
    font-size: 0.875rem;
    line-height: 140%;
    color: rgba(255, 255, 255, 0.7);
    margin-bottom: 0.625rem;
  }

  &__video {
    margin-bottom: 2.25rem;
    display: flex;
    align-items: center;
  }

  &__video-play {
    width: 2.625rem;
    height: 2.625rem;
    border-radius: 50%;
    background-image: url(../../assets/images/play.svg);
    background-repeat: no-repeat;
    background-position: right 0.8125rem center;
    background-color: $blue;
    box-shadow: 0 14px 64px rgba(70, 161, 209, 0.42);
    margin-right: 0.75rem;
  }

  &__video-text {
    font-weight: bold;
    font-size: 0.875rem;
    line-height: 110%;
    max-width: 4.5rem;
  }

  &__social {
    display: flex;

    & .social__icon {
      margin-bottom: 0;
      margin-right: 0.9375rem;
    }
  }
}

.play-icon {
  cursor: pointer;
  width: 3.625rem;
  height: 3.625rem;
  border-radius: 50%;
  background-image: url(../images/play.svg);
  background-repeat: no-repeat;
  background-position: right 1.25rem center;
  background-color: $blue;
  box-shadow: 0 14px 64px rgb(70 161 209 / 42%);
  margin-right: 0.75rem;
  transition: all 0.3s ease 0s;

  svg path {
    transition: all 0.3s ease 0s;
  }

  &:hover {
    background-color: $white;

    svg path {
      fill: $blue;
    }

  }
}

.breadcrumbs {
  display: flex;
  align-items: center;
  margin-bottom: 1.5625rem;

  &--center {
    justify-content: center;
    margin-bottom: 1.5625rem;
  }

  &__link {
    font-weight: bold;
    font-size: 0.875rem;
    line-height: 100%;
    color: rgba(27, 51, 85, 0.5);
    transition: all 0.3s ease 0s;

    &:hover {
      color: $dark-blue;
    }

    &:last-child {
      color: $dark-blue;
    }
  }

  &__divider {
    background-color: rgba(27, 51, 85, 0.5);
    width: 0.25rem;
    height: 0.25rem;
    border-radius: 50%;
    margin: 0 0.75rem;
    display: inline-block;

    &--blue {
      background-color: $dark-blue;
    }
  }
}

.news {
  &__card {
    padding: 2.5rem;
    position: relative;
    max-height: 30.25rem;

    & .btn {
      width: max-content;
    }

    &:first-child {
      grid-row-start: 1;
      grid-row-end: 3;
    }
  }

  &__info {
    position: relative;
    z-index: 2;
    display: grid;
    grid-template-rows: 1fr auto;
    height: 100%;
  }

  &__card-img {
    position: absolute;
    inset: 0;
    width: 100%;
    height: 100%;
    object-fit: cover;
    z-index: -1;
  }

  &__card--bg {
    position: relative;

    &::after {
      content: "";
      width: 100%;
      height: 100%;
      position: absolute;
      inset: 0;
      background-image: linear-gradient(98.74deg, rgba(28, 49, 85, 0.9) 0%, rgba(36, 89, 181, 0.9) 94.47%);
      box-shadow: 0 24px 74px rgba(29, 50, 86, 0.11);
      z-index: -1;
    }

    .news__tag {
      color: rgba(255, 255, 255, 0.6);

      &::before {
        background-color: rgba(255, 255, 255, 0.6);
      }
    }
  }

  &__tag {
    font-weight: 600;
    font-size: 0.875rem;
    line-height: 100%;
    margin-bottom: 0.9375rem;
    display: inline-flex;
    align-items: center;

    &::before {
      content: '';
      background-color: inherit;
      width: 0.25rem;
      height: 0.25rem;
      border-radius: 50%;
      display: inline-block;
      background-color: $dark-blue;
      margin-right: 0.3125rem;
    }
  }

  &__title {
    font-weight: bold;
    font-size: 1.5rem;
    line-height: 120%;
    letter-spacing: -0.01em;
    color: $white;
    margin-bottom: 0.9375rem;
    max-width: 15.3125rem;
  }

  &__title--big {
    font-size: 2.25rem;
    line-height: 110%;
    letter-spacing: 0;
    max-width: none;
  }

  &__descr {
    font-size: 1rem;
    line-height: 180%;
    color: $white;
    margin-bottom: 1.875rem;
  }

  &__card--white {
    background-color: $white;
    box-shadow: 0 24px 74px rgba(29, 50, 86, 0.11);
    background-image: url(../../assets/images/card-white-logo.svg);
    background-repeat: no-repeat;
    background-position: bottom right 1.875rem;

    .news__tag {
      color: rgba(22, 60, 126, 0.6);

      &::before {
        background-color: rgba(22, 60, 126, 0.6);
      }
    }

    .news__title {
      color: $dark-blue;
    }
  }
}

.types {

  &__cards {
    display: grid;
    grid-template-columns: 1fr 30.5rem;
    grid-template-rows: 1fr 1fr;
    gap: 1.25rem;
  }
}
